	private static final List<Long> getRandoms(int count) {
		//SecureRandom rand = new SecureRandom();
		Random rand = new Random();
		List<Long> result = new ArrayList<Long>();
		int current = 0;
		while(current < count) {
			result.add(rand.nextLong());
			current++;
		}
		return result;
	}
	
	private static void genMembers() {
		List<Long> numbers = getRandoms(COUNT);
		
		String result = "public static final long[] NUMBERS = new long[] {";
		
		for (int i=0; i<numbers.size(); i++) {
			result += "" + numbers.get(i) + "L, ";
			if (i % 64 == 0) {
				result += "\r\n";
			}
		}
		
		result += "};";
		
		System.out.println(result);
	}
	
