	private static List<Long> read(String file) throws Exception {
		return read(new FileInputStream(file));
	}
	
	private static List<Long> read(InputStream is) throws Exception {
		ObjectInputStream oos = new ObjectInputStream(is);
		return (List<Long>) oos.readObject();
	}
	
	private static void write(List<Long> list, String file) throws Exception {
		ObjectOutputStream oos = new ObjectOutputStream(new FileOutputStream(file));
		oos.writeObject(list);
	}
